import { React, useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const EmployeeList = () => {
    const [employeesList, setEmployeesList]=useState({});
    const navigate=useNavigate();

    useEffect(() => {

    }, []);

    const onButtonClick = () =>{
        navigate('/create');
    }

    return (
        <div style={{ marginTop: '50px', marginLeft: '150px' }}>
            <div style={{ padding: '5px' }}>Logo</div>
            <div style={{ borderWidth: '2px', borderStyle: 'solid', borderColor: 'black', borderBottomWidth:'0px', padding: '2px', width: '1196px', display: 'flex', justifyContent: 'space-around', backgroundColor: '#C3DDEF'}}>
                <a href='/' style={{textDecoration: 'none', color: 'black'}}>Home</a>
                <a href='/' style={{textDecoration: 'none', color: 'black'}}>Employee List</a>
                <a href='/' style={{textDecoration: 'none', color: 'black'}}>Hukum Gupta-</a>
                <a href='/login' style={{textDecoration: 'none', color: 'black'}}>Logout</a>
            </div>
            <div style={{ borderWidth: '2px', borderStyle: 'solid', borderColor: 'black', width: '1200px', height: ''}}>
                <div style={{ backgroundColor: 'yellow', padding: '2px', paddingBottom: '5px', paddingLeft: '4px' }}>Employee List</div>
                <div style={{display: 'flex', justifyContent: 'right', padding: '2px'}}>
                    <span style={{marginRight: '100px'}}>Total Count:</span> 
                    <button
                        style={{ marginRight: '100px', backgroundColor: 'yellowgreen', height: '25px', width: '250px', borderWidth: '0', cursor: 'pointer' }}
                        onClick={() => onButtonClick()}
                    >Create Employee</button>
                </div>
                <table style={{width:'1200px'}}>
                    <thead>
                        {/* {employeesList && employeesList.length > 0 && */}
                            <tr style={{ display: 'flex', justifyContent: 'space-around' }}>
                                <td style={{ width: '116.3px', border: '1px solid black' }}>Unique Id</td>
                                <td style={{ width: '116.3px', border: '1px solid black' }}>Image</td>
                                <td style={{ width: '116.3px', border: '1px solid black' }}>Name</td>
                                <td style={{ width: '116.3px', border: '1px solid black' }}>Email</td>
                                <td style={{ width: '116.3px', border: '1px solid black' }}>Mobile No</td>
                                <td style={{ width: '116.3px', border: '1px solid black' }}>Designation</td>
                                <td style={{ width: '116.3px', border: '1px solid black' }}>gender</td>
                                <td style={{ width: '116.3px', border: '1px solid black' }}>Course</td>
                                <td style={{ width: '116.3px', border: '1px solid black' }}>Created date</td>
                                <td style={{ width: '116.3px', border: '1px solid black' }}>Action</td>
                            </tr>
                    </thead>
                    <tbody>
                        {
                            employeesList && employeesList.length > 0 ? employeesList.map(e => (
                                <tr style={{ display: 'flex', justifyContent: 'space-around' }}>
                                    <td style={{ width: '116.3px', border: '1px solid black' }}>e._id</td>
                                    <td style={{ width: '116.3px', border: '1px solid black' }}><img href={e.image} /></td>
                                    <td style={{ width: '116.3px', border: '1px solid black' }}>e.name</td>
                                    <td style={{ width: '116.3px', border: '1px solid black' }}>e.email</td>
                                    <td style={{ width: '116.3px', border: '1px solid black' }}>e.mobile_no</td>
                                    <td style={{ width: '116.3px', border: '1px solid black' }}>e.designation</td>
                                    <td style={{ width: '116.3px', border: '1px solid black' }}>e.gender</td>
                                    <td style={{ width: '116.3px', border: '1px solid black' }}>{e.course && e.course.length > 0 && e.course.map(c => (<><label>c</label><br/></>))}</td>
                                    <td style={{ width: '116.3px', border: '1px solid black' }}>e.created_date</td>
                                    <td style={{ width: '116.3px', border: '1px solid black' }}><a>Edit</a>-<a>Delete</a></td>
                                </tr>
                            )) : <tr style={{display: 'flex', justifyContent: 'center'}}>No Employees found</tr>
                        }
                    </tbody>
                </table>
            </div>
        </div>
    )
}

export default EmployeeList;
